import React from 'react';
import OfferHeader from '../offerHeader/offerHeader';
import Catalogue from '../catalogue/catalogue';
import { Fragment } from 'react/cjs/react.production.min';

function Home(props) {
    return(
        <Fragment>
            <OfferHeader />
            <Catalogue />
        </Fragment>
    );
}

export default Home;
